.dynamic-border {
    margin-left: 10px;
    margin-right: 10px;
    min-height: 12vh;
    cursor: pointer;
    position: relative;
    padding: 20px 10px 10px 10px;
    border-top-right-radius: 10px;
    border-bottom-left-radius: 10px;
    transition: all 1s;
    margin-bottom: 25px;
}
.dynamic-border:after, .dynamic-border:before {
    content: " ";
    width: 10px;
    height: 10px;
    position: absolute;
    border: 0px solid #fff;
    transition: all 1s;
}
.dynamic-border:after {
    top: 0px;
    left: 0px;
    border-top: 3px solid mediumpurple;
    border-left: 3px solid mediumpurple;
}
.dynamic-border:before {
    bottom: 0px;
    right: 0px;
    border-bottom: 3px solid mediumspringgreen;
    border-right: 3px solid mediumspringgreen;
}
.dynamic-border:hover {
    box-shadow: 0 0.7rem 0.7rem #1b1e21;
    transition: all 2000ms ease;
    transition-property: box-shadow;
    border-radius: 0 !important;
}
.dynamic-border:hover:before, .dynamic-border:hover:after {
    width: 100%;
    height: 100%;
}

